package edu.mayo.informatics.lexgrid.convert.directConversions.medDRA.Data;public enum MedDRA_Metadata {    HISTORY                 ("meddra_history_english.asc", "MeddraHistory", MedDRARecord_meddra_history.class),    RELEASE                 ("meddra_release.asc", "MeddraRelease", MedDRARecord_meddra_release.class),    LOW_LEVEL_TERMS         ("llt.asc", "LowLevelTerms", MedDRARecord_llt.class),    PREF_TERMS              ("pt.asc", "PreferredTerms", MedDRARecord_pt.class),    HIGH_LEVEL_TERMS        ("hlt.asc", "HighLevelTerms", MedDRARecord_hlt.class),    HLT_PT_MAP              ("hlt_pt.asc", "MapHLT2PT", MedDRARecord_hlt_pt.class),    HIGH_LEVEL_GROUP_TERMS  ("hlgt.asc", "HighLevelGroups", MedDRARecord_hlgt.class),    HLGT_HLT_MAP            ("hlgt_hlt.asc", "MapHLGT2HLT", MedDRARecord_hlgt_hlt.class),    SYSTEM_ORGAN_CLASSES    ("soc.asc", "SystemOrganClasses",  MedDRARecord_soc.class),    SOC_HLGT_MAP            ("soc_hlgt.asc", "MapSOC2HLGT", MedDRARecord_soc_hlgt.class),    MD_HIERARCHY            ("mdhier.asc", "MDHierarchy", MedDRARecord_mdhier.class),    SOC_INTL_MAP            ("intl_ord.asc", "MapSOC2INTL", MedDRARecord_intl_ord.class),    SMQ_LIST                ("smq_list.asc", "SMQList", MedDRARecord_smq_list.class),    SMQ_CONTENT             ("smq_content.asc", "SMQContent", MedDRARecord_smq_content.class);    private String filename;    private String tablename;    private Class<?> classname;        MedDRA_Metadata(String filename, String tablename, Class<?> classname){        this.filename = filename;        this.tablename = tablename;        this.classname = classname;    }    public String filename(){        return this.filename;    }        public String tablename(){        return this.tablename;    }        @SuppressWarnings("unchecked")    public Class<DatabaseRecord> classname(){        return (Class<DatabaseRecord>) this.classname;    }}    